  namespace: SuperOffice.CRM.ArchiveLists.Aggregation
  summary: 'Aggregation plugin: Extract a date part, specified as a modifier'
  remarks: >-
    This aggregator produces no aggregated value; instead it returns modified

    detail rows. The return value is an integer, the specified part of the date

    that is the incoming item.

    <table><thead><tr><th class="term">Modifier</th><th class="description">What you get</th></tr></thead><tbody><tr><td class="term">Year</td><td class="description">4-digit year</td></tr><tr><td class="term">Quarter</td><td class="description">Single-digit quarter, starting at 1</td></tr><tr><td class="term">Month</td><td class="description">2-digit month</td></tr><tr><td class="term">Day</td><td class="description">2-digit day of month</td></tr><tr><td class="term">DayOfYear</td><td class="description">Day of year, 1-366</td></tr><tr><td class="term">DayOfWeek</td><td class="description">Day of week, 0=Sunday, 6=Saturday</td></tr><tr><td class="term">Hour</td><td class="description">2-digit 24h-hour</td></tr><tr><td class="term">Weekno</td><td class="description">Week number</td></tr><tr><td class="term">YearMonth</td><td class="description">4-digit year slash 2-digit month</td></tr><tr><td class="term">YearWeekno</td><td class="description">4-digit year slash 2-digit week number</td></tr><tr><td class="term">YearQuarter</td><td class="description">4-digit year slash single-digit quarter number</td></tr></tbody></table>
  example: []
  syntax:
    content: >-
      [AggregationPlugin("DatePart")]

      public class DatePartAggregation : AggregationPluginBase, IAggregationScalarPlugin, IAggregationPlugin
    content.vb: >-
      <AggregationPlugin("DatePart")>

      Public Class DatePartAggregation Inherits AggregationPluginBase Implements IAggregationScalarPlugin, IAggregationPlugin
